CREATE TABLE HOSPITAL ( 
  CD_HOSPITAL INTEGER PRIMARY KEY, -- CÓDIGO DO HOSPITAL 
  NM_HOSPITAL TEXT NOT NULL,       -- NOME DO HOSPITAL 
  NR_LATITUDE NUMBER NOT NULL,     -- LATITUDE HOSPITAL 
  NR_LONGITUDE NUMBER NOT NULL     -- LONGITUDE HOSPITAL 
); 

CREATE TABLE MEDICO ( 
  CD_MEDICO INTEGER PRIMARY KEY,  -- CÓDIGO DO MÉDICO
  NM_MEDICO varchar NOT NULL      -- NOME DO MÉDICO
); 

CREATE TABLE CHAMADO ( 
  NR_CHAMADO INTEGER PRIMARY KEY,  -- NÚMERO DO CHAMADO 
  CD_HOSPITAL INTEGER NOT NULL,    -- CÓDIGO DO HOSPITAL 
  IE_TIPO_CHAMADO char,            -- TIPO DE ATENDIMENTO - 1 = PRONTO SOCORRO / 2 = INTERNADO 
  NM_PACIENTE varchar,             -- NOME DO PACIENTE 
  IE_SEXO varchar,                 -- SEXO BIOLÓGICO DO PACIENTE - M = MASCULINO / F = FEMININO / N = NÃO INFORMADO 
  IE_STATUS_CHAMADO varchar,       -- STATUS DO CHAMADO - A = ABERTO / E = ENCERRADO / C = CANCELADO
  CD_MEDICO INTEGER,                
  FOREIGN KEY(CD_HOSPITAL) REFERENCES HOSPITAL(CD_HOSPITAL),
  FOREIGN KEY(CD_MEDICO) REFERENCES MEDICO(CD_MEDICO)
  
); 





